                var html_945a1cd071612e2fc5aee4125fcd313e = $(`<div id="html_945a1cd071612e2fc5aee4125fcd313e" style="width: 100.0%; height: 100.0%;">     <h4>VILLA BURI</h4>     <p>     Il parco di Villa Buri si estende per una superficie di 13 ettari ricca di flora e fauna. Infatti, il parco comprende, al suo interno, ben 1800 diverse piante, tra cui alcune piante secolari.     Per lo svago e l’intrattenimento delle famiglie, nel parco si possono trovare campi da calcio e da pallavolo. Inoltre, il parco offre anche un percorso sensoriale nel bosco e comprende un orto botanico,      viene attualmente curato dall’Associazione Amici di Villa Bosco Buri.     </p>     <img src="https://upload.wikimedia.org/wikipedia/commons/5/5e/Verona_-_Villa_Buri.JPG"     style="max-width:300px;"> <audio controls><source src="https://github.com/illRoncc/illRoncc.github.io/raw/main/audio_villa_buri.mp3" type="audio/mpeg"></audio></div>`)[0];

    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["Nome comune", "Nome scientifico", "Diametro (cm)", "Altezza (approssimata in metri)"];
    let aliases = ["Nome comune", "Nome scientifico", "Diametro (cm)", "Altezza (approssimata in metri)"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
